Malaria, zimnica (śrdw. wł. mala aria ‘złe powietrze’; łac. malaria, plasmodiosis, dawne nazwy: febra z łac. febris = gorączka i paludyzm) – ostra lub przewlekła, tropikalna choroba pasożytnicza, której różne postacie wywoływane są przez jeden lub więcej z pięciu gatunków jednokomórkowego pierwotniaka z rodzaju Plasmodium: 
* zarodźca ruchliwego (Plasmodium vivax); 
* zarodźca pasmowego (Plasmodium malariae); 
* zarodźca sierpowatego (Plasmodium falciparum); 
* zarodźca owalnego (Plasmodium ovale); 
* (Plasmodium knowlesi). Wyniki najnowszych badań wykazały, że występujący w Azji Południowo-Wschodniej zarodziec małpi, który – jak wcześniej sądzono – jest chorobotwórczy przede wszystkim dla małp, może także prowadzić do zarażeń u człowieka. Jego cechy podobne są do zarodźca malarycznego, ale przebieg zachorowania jest ciężki i zbliżony do zarodźca sierpowatego. U człowieka najczęściej dochodzi do zarażeń zarodźcem ruchliwym i sierpowatym, przy czym ten ostatni powoduje najcięższą postać choroby i stosunkowo najczęściej prowadzi do zgonu. Inne gatunki z rodzaju Plasmodium zarażają zwierzęta. Wektorem malarii przenoszącym ją między osobami chorymi i zdrowymi są samice komarów z rodzaju Anopheles. Jest to najczęstsza na świecie choroba zakaźna, na którą co roku zapada ponad 220 mln osób, a umiera 1–3 mln (są to głównie dzieci poniżej 5 roku życia z Czarnej Afryki). Szacuje się, że w roku 2016 zachorowało na malarię 216 milionów osób, to jest o 5 milionów osób więcej w porównaniu z rokiem 2015. Zachorowania poza terenami tropikalnymi i subtropikalnymi endemicznego występowania tej choroby spotykane są u osób powracających z tych regionów, a także sporadycznie w pobliżu lotnisk i portów, gdzie zostają zawleczone komary z rodzaju Anopheles.
